import React from 'react';

const UrlList = () => {
    return (
        <>
            <h2>Url list</h2>
            <h3>
                See Where It Goes
                    <span role="img" aria-label="silly-face">
                    ðŸ¤ª
                    </span>
            </h3>
            <hr />
            <div className="container">
                {this.state.munchList.map(({ id, link, color, key }) => {
                    parser = new Url(link);
                    return (
                        <div key={id}>
                            <h5>{parser.hostname.replace("www.", "")}</h5>
                            <button className={`url-btn ${color}`}>
                                <a
                                    rel="noopener noreferrer"
                                    target="_blank"
                                    href={link}
                                >{`Munch.ly/${key}`}</a>
                            </button>
                        </div>
                    );
                })}
            </div>
        </>
    );
};

export default UrlList;
